  function pack(
    uint256 _totalPacks,
    bytes32[] memory _tokenHash,
    address _sender
  ) private returns (bytes32) {
    // maybe dummy, but 2 loops, one to check permissions the other to alter the tokens
    for (uint256 i = 0; i < _tokenHash.length; i++) {
      // check for permissions and the status of the token
      FCToken storage tkn = _universeTokens[_tokenHash[i]];

      require(_sender == tkn.holder, "You are not allowed, different holder");
      require(tkn.status == 1, "Token has to be available");
    }

    // Increment user's nonce
    userNonces[msg.sender]++;
    uint256 toHash = block.timestamp + 1;
    bytes32 packHash = keccak256(
      abi.encode(msg.sender, userNonces[msg.sender], toHash)
    );

    FinalProductsMapping storage product = _finalProducts[packHash];
    product.totalPacks = _totalPacks;
    product._producer = _sender;
    product.created_on = block.timestamp;
    for (uint256 i = 0; i < _tokenHash.length; i++) {
      FCToken storage tkn = _universeTokens[_tokenHash[i]];
      tkn.status = 3;
      product._tokens.push(_tokenHash[i]);
    }

    _userPacks[msg.sender].push(packHash);
    return packHash;
  }

  function createSuperPack(
    uint256 _totalPacks,
    bytes32[] memory _tokenHashes,
    uint256[] memory _quantities
  ) public payable returns (bytes32[] memory) {
    require(
      _tokenHashes.length == _quantities.length,
      "Tokens and quantities length mismatch"
    );
    for (uint256 i = 0; i < _tokenHashes.length; i++) {
      // check for permissions and the status of the token
      FCToken storage tkn = _universeTokens[_tokenHashes[i]];

      require(
        msg.sender == tkn.holder,
        "You are not allowed, different holder"
      );
      require(tkn.status == 1, "Token has to be available");
    }

    // Temporary storage for new or original token hashes to be packed
    bytes32[] memory allPackHashes = new bytes32[](1);

    // Increment user's nonce
    userNonces[msg.sender]++;
    uint256 toHash = block.timestamp + 1;
    bytes32 superPackHash = keccak256(
      abi.encode(msg.sender, userNonces[msg.sender], toHash)
    );

    _userSuperPacks[msg.sender].push(superPackHash);

    // Temporary storage for new or original token hashes to be packed for this iteration
    bytes32[] memory tokensToPack = new bytes32[](_tokenHashes.length);

    for (uint256 i = 0; i < _tokenHashes.length; i++) {
      FCToken storage tkn = _universeTokens[_tokenHashes[i]];

      if (tkn.amount != (_quantities[i] * _totalPacks)) {
        // block execution if requested quantity is greater than the token current amount
        require(
          (_quantities[i] * _totalPacks) < tkn.amount,
          "Quantity exceeds available token amount"
        );
        tokensToPack[i] = split_token(
          tkn.ingridientID,
          _tokenHashes[i],
          _quantities[i] * _totalPacks
        );
      } else {
        tokensToPack[i] = _tokenHashes[i];
      }
    }

    // Pack the tokens and store the pack hash
    bytes32 packHash = pack(_totalPacks, tokensToPack, msg.sender);
    allPackHashes[0] = packHash;
    _superPacksMapping[superPackHash].push(packHash);
    // Emit an event with the pack hash
    emit PackCreated(msg.sender, packHash);

    return allPackHashes;
  }

